column8:
ロングシーズン着回せる、サラッと肌触りの良い薄手裏毛素材のパーカーが登場★<br>
パーカーとしては細めのシルエットですっきり着こなせ、スカートとも好相性です♪<br>
M・Lの２サイズ展開で、ゆったりめがお好みの方はLサイズがオススメ！<br>
